import React from 'react';
import { Button, Linking, RefreshControl, ScrollView, StyleSheet, Text, View } from 'react-native';
import { useState } from 'react';
import Home from './comonent/Home';

const App = ()=>{
  return(

    <View>

      <Text style={{fontSize:40,margin:10,alignContent:'center',flex:1,textAlign:'center'}} >
        App Activity
      </Text>

<View style={{}}>

<Button
          title="Click To Next Activity!"
          onPress={<Home/>}
        />

</View>

    </View>
  )
}

export default App;
